    // 현재 객체 레벨의 모든 속성 키를 가져와 Set에 추가
    Reflect.ownKeys(tco).forEach((tk) => {
        tset.add(tk);
    });

    // 다음 프로토타입으로 이동
    tco = Reflect.getPrototypeOf(tco);
    console.log('>>> ' + tco);

  }

  return Array.from(tset);
};
